import React from 'react';
import { BrowserRouter as Router } from "react-router-dom";
import {
  Navbar,
  Clippeddrawer,
  CalendarCard,
  FunctionCard,
  SearchField,
} from "./components";

import { ReactComponent as ReportsIcon } from "./assets/Document Landscape Data.svg";

function App() {
  return (
    <div className="App">
      <Router>
        <Navbar/>
        <Clippeddrawer/>
        <CalendarCard/>
        <SearchField/>
        <FunctionCard     
          id={"report"}
          text={"SITREP Reports"}
          >
            <ReportsIcon/>
          </FunctionCard>
      </Router>
    </div>
  );
}

export default App;
